window.bookSummaryJSON = "<p>First lesson of Wolf Ridge High: Dominate or submit.</p> <p>It’s a wolf-eat-wolf school, and those on the top–like my stepbrother–rule all.</p> <p>Those of us on the bottom? We try to fly under the radar.<br> <br> But now that my name is attached to Wilde’s, now that we’re “family,” there’s no more hiding.<br> <br> And the cocky baller is out to punish me for the crime of dragging down his reputation.<br> <br> He discovered my secret and uses it against me.<br> <br> I would rather die than have anyone find out.</p> <p>So I give into his demands.<br> <br> My bed.<br> My body.<br> My submission.<br> <br> And the worst part? I don’t want it to stop.</p>"; 
